import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    { title: "Toilet Paper", amount: "$200", date: new Date(2022, 2, 28) },
    { title: "Car Insurance", amount: "$200", date: new Date(2022, 2, 28) },
    { title: "Monitor", amount: "$460", date: new Date(2022, 5, 14) },
    { title: "Food", amount: "$50", date: new Date(2022, 2, 28) },
  ];
  return (
    <div>
      <Expenses expenses = {expenses}></Expenses>
      <Expenses expenses = {expenses}></Expenses>
      <Expenses expenses = {expenses}></Expenses>
      <Expenses expenses = {expenses}></Expenses>
    </div>
  );
}

export default App;
